import React, { useState } from 'react';
import axios from 'axios';

const ClientManagement = () => {
  const [clientForm, setClientForm] = useState({
    firstName: '',
    lastName: '',
    middleName: '',
    dateOfBirth: '',
    gender: '',
    nationality: '',
    address: '',
    city: '',
    stateOrProvince: '',
    postalCode: '',
    email: '',
    phoneNumber: '',
    passportNumber: '',
    passportExpirationDate: '',
    hasDiabetes: false,
    hasLowBloodPressure: false,
    hasHighBloodPressure: false,
    hasEpilepsy: false,
    hasHeartDisease: false,
    hasBreathingDifficulty: false,
    hasHadSurgery: false,
    surgeryDetails: ''
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // Get today's date and set it as the maximum date for the dateOfBirth input
  const today = new Date();
  const maxDate = `${today.getFullYear() - 1}-${String(today.getMonth() + 1).padStart(2, '0')}-${String(today.getDate()).padStart(2, '0')}`;

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setClientForm({
      ...clientForm,
      [name]: type === 'checkbox' ? checked : value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5000/api/clients', clientForm);
      setSuccess('Client added successfully!');
      setClientForm({
        firstName: '',
        lastName: '',
        middleName: '',
        dateOfBirth: '',
        gender: '',
        nationality: '',
        address: '',
        city: '',
        stateOrProvince: '',
        postalCode: '',
        email: '',
        phoneNumber: '',
        passportNumber: '',
        passportExpirationDate: '',
        hasDiabetes: false,
        hasLowBloodPressure: false,
        hasHighBloodPressure: false,
        hasEpilepsy: false,
        hasHeartDisease: false,
        hasBreathingDifficulty: false,
        hasHadSurgery: false,
        surgeryDetails: ''
      });
      setError('');
    } catch (error) {
      setError('Error saving client');
      setSuccess('');
    }
  };

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-4">Add New Client</h1>

      {error && <p className="text-red-500 mb-4">{error}</p>}
      {success && <p className="text-green-500 mb-4">{success}</p>}

      <form onSubmit={handleSubmit} className="bg-white p-6 rounded-lg shadow-md">
        <input
          type="text"
          name="firstName"
          placeholder="First Name"
          value={clientForm.firstName}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          required
        />
        <input
          type="text"
          name="lastName"
          placeholder="Last Name"
          value={clientForm.lastName}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          required
        />
        <input
          type="text"
          name="middleName"
          placeholder="Middle Name"
          value={clientForm.middleName}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
        />
        <input
          type="date"
          name="dateOfBirth"
          value={clientForm.dateOfBirth}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          required
          max={maxDate}
        />
        <select
          name="gender"
          value={clientForm.gender}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
        >
          <option value="">Select Gender</option>
          <option value="Male">Male</option>
          <option value="Female">Female</option>
          <option value="Other">Other</option>
        </select>
        <input
          type="text"
          name="nationality"
          placeholder="Nationality"
          value={clientForm.nationality}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          required
        />
        <input
          type="text"
          name="address"
          placeholder="Address"
          value={clientForm.address}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          required
        />
        <input
          type="text"
          name="city"
          placeholder="City"
          value={clientForm.city}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          required
        />
        <input
          type="text"
          name="stateOrProvince"
          placeholder="State or Province"
          value={clientForm.stateOrProvince}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
        />
        <input
          type="text"
          name="postalCode"
          placeholder="Postal Code"
          value={clientForm.postalCode}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          required
        />
        <input
          type="email"
          name="email"
          placeholder="Email"
          value={clientForm.email}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          required
        />
        <input
          type="tel"
          name="phoneNumber"
          placeholder="Phone Number"
          value={clientForm.phoneNumber}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          required
        />
        <input
          type="text"
          name="passportNumber"
          placeholder="Passport Number"
          value={clientForm.passportNumber}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          required
        />
        <input
          type="date"
          name="passportExpirationDate"
          value={clientForm.passportExpirationDate}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          required
        />
        <div className="flex items-center mb-4">
          <input
            type="checkbox"
            name="hasDiabetes"
            checked={clientForm.hasDiabetes}
            onChange={handleChange}
            className="mr-2"
          />
          <label>Has Diabetes</label>
        </div>
        <div className="flex items-center mb-4">
          <input
            type="checkbox"
            name="hasLowBloodPressure"
            checked={clientForm.hasLowBloodPressure}
            onChange={handleChange}
            className="mr-2"
          />
          <label>Has Low Blood Pressure</label>
        </div>
        <div className="flex items-center mb-4">
          <input
            type="checkbox"
            name="hasHighBloodPressure"
            checked={clientForm.hasHighBloodPressure}
            onChange={handleChange}
            className="mr-2"
          />
          <label>Has High Blood Pressure</label>
        </div>
        <div className="flex items-center mb-4">
          <input
            type="checkbox"
            name="hasEpilepsy"
            checked={clientForm.hasEpilepsy}
            onChange={handleChange}
            className="mr-2"
          />
          <label>Has Epilepsy</label>
        </div>
        <div className="flex items-center mb-4">
          <input
            type="checkbox"
            name="hasHeartDisease"
            checked={clientForm.hasHeartDisease}
            onChange={handleChange}
            className="mr-2"
          />
          <label>Has Heart Disease</label>
        </div>
        <div className="flex items-center mb-4">
          <input
            type="checkbox"
            name="hasBreathingDifficulty"
            checked={clientForm.hasBreathingDifficulty}
            onChange={handleChange}
            className="mr-2"
          />
          <label>Has Breathing Difficulty</label>
        </div>
        <div className="flex items-center mb-4">
          <input
            type="checkbox"
            name="hasHadSurgery"
            checked={clientForm.hasHadSurgery}
            onChange={handleChange}
            className="mr-2"
          />
          <label>Has Had Surgery</label>
        </div>
        {clientForm.hasHadSurgery && (
          <textarea
            name="surgeryDetails"
            placeholder="Details of Surgery"
            value={clientForm.surgeryDetails}
            onChange={handleChange}
            className="w-full p-2 border border-gray-300 rounded-lg mb-4"
          />
        )}
        <button type="submit" className="bg-blue-500 text-white py-2 px-4 rounded-lg">
          Add Client
